import React, { Component } from 'react';

class text_tbody extends Component {
    constructor(props)
    {
        super(props)
        this.state = {
          tblhead: [
              {
                  title: 'H1',
                  title1: 'Size: 96pt',
                  title2: 'Line: 96pt',
                  class: 'h1',
              },

            ]
        }

    }
    render() {
        return (
            <>
              {
                 this.state.tblhead.map((rowdata,i) =>
                 <tr>
                    <td>
                         <p className="overline text-light-gray w-100">{rowdata.title}</p>
                         <p className="body2 text-black w-100">{rowdata.title1}</p>
                         <p className="body2 text-black w-100">{rowdata.title2}</p>
                     </td>
                     <td>
                         <p className={rowdata.class}>Aa</p>
                     </td>
                 </tr>
                )
           }
            </>
        );
    }
}

export default text_tbody;
